Push an object to a nested array within a document but use a value from a field in the root document<p>I've been scratching my head with this problem. I've attempted to search for a solution but I didn't find anything relating to my specific use case.</p>
<p>Would anyone be able to help me out?</p>
<blockquote>
<p>Say I have a collection of &quot;discount&quot; documents, and importantly they have an &quot;amount&quot; field to say how much the discount is worth. Whenever a discount is redeemed I currently want to track what the worth was at the time of the redemption.</p>
</blockquote>
<p>To do this I've been attempting to use the following code:</p>
<pre class="lang-js prettyprint-override"><code>await datastore.collection('discounts').updateOne(
  {
    $expr: { $gt: [ '$maxUses', '$uses' ] },
    ...criteria
  },
  {
    $set: {
      uses: 1
    },
    $push: {
      redemptions: {
        name: concatNames(user),
        email: user.email,
        amount: '$amount', // &lt;-- use amount from root document
        when: new Date()
      }
    }
  }
)
</code></pre>
<p>Unfortunately <code>$amount</code> does not pull the value from the root document, instead it just becomes &quot;$amount&quot; as a string. I've also attempted to convert this update to use a pipeline but <code>$push</code> is not a valid pipeline stage.</p>
<p>Here's a quick <a href="https://mongoplayground.net/p/aqGfzfprRND" rel="nofollow noreferrer">Mongo playground</a> link.</p>
<p>Thanks in advance.</p>

