String version of MongoDB WithID typescript generic<p>The <code>WithId</code> generic that comes with Mongo's typescript library is highly useful in scenarios where you don't want to modify your existing interface/type for use with MongoDB such as:</p>
<pre><code>export class TagsCl {
    private publicTags: Promise&lt;Array&lt;WithId&lt;ProductTag&gt;&gt;&gt;;
    private allTags: Promise&lt;Array&lt;WithId&lt;ProductTag&gt;&gt;&gt;;
    private tags: Collection&lt;ProductTag&gt;;
        constructor(){
            //...
        }
        //...
}
</code></pre>
<p>I'd like a very similar generic called <code>WithStrId</code> or <code>WithStringId</code> or whatever that accomplishes the same thing, but adds a field with <code>_id: string</code> instead to an existing type/interface, for use in the front-end. What's the easiest way to make such a generic?</p>
<p>The existing <code>WithId</code> looks a bit complicated</p>
<pre><code>/** TypeScript Omit (Exclude to be specific) does not work for objects with an &quot;any&quot; indexed type, and breaks discriminated unions @public */
export declare type EnhancedOmit&lt;TRecordOrUnion, KeyUnion&gt; = string extends keyof TRecordOrUnion ? TRecordOrUnion : TRecordOrUnion extends any ? Pick&lt;TRecordOrUnion, Exclude&lt;keyof TRecordOrUnion, KeyUnion&gt;&gt; : never;
export declare type InferIdType&lt;TSchema&gt; = TSchema extends {
    _id: infer IdType;
} ? Record&lt;any, never&gt; extends IdType ? never : IdType : TSchema extends {
    _id?: infer IdType;
} ? unknown extends IdType ? ObjectId : IdType : ObjectId;

export declare type WithId&lt;TSchema&gt; = EnhancedOmit&lt;TSchema, '_id'&gt; &amp; {
    _id: InferIdType&lt;TSchema&gt;;
};
</code></pre>

