                         &lt;form action=&quot;/download/&lt;%= data[i]._id %&gt;&quot; method=&quot;GET&quot;&gt;
                          &lt;input type=&quot;submit&quot; value=&quot;Download&quot;&gt;
                        &lt;/form&gt;
                        &lt;form action=&quot;/delete/&lt;%= data[i]._id %&gt;&quot; method=&quot;GET&quot;&gt;
                            &lt;input type=&quot;submit&quot; value=&quot;Delete&quot;&gt;
                          &lt;/form&gt;
                     &lt;/td&gt;
                 &lt;/tr&gt;
                &lt;% } %&gt;


            &lt;/tbody&gt;
        &lt;/table&gt;
 &lt;/body&gt;
 &lt;/html&gt;
